import '../src/App.css';


const App =_=> {
  const dispatch = useDispatch();
  const photos = useSelector(state => state.gallery.photos);

  useEffect(() => {
    dispatch(getPhotos());
  }, [dispatch]);

  console.log(photos);
  return (
    <div>
      <h1>Photo Gallery</h1>
      <p>This is a photo gallery made using redux toolkit and redux thunk.</p>
      <hr/>
      <div>
        {/* {photos.map(photo => 
